    'confident':
        'iStoma este un soft de gestiune a clinicilor si cabinetelor stomatologice dezvoltat, intretinut si comercializat de IDAVA SOLUTIONS SRL, cu sediul în ELECTROMAGNETICA BUSINESS PARK, Sector 5, București, înmatriculată la Registrul Comerțului sub numărul J40/20674/17.10.2022, având CUI RO30410797.\nCE INFORMAȚII COLECTĂM?\nINFORMAȚIILE OFERITE VOLUNTAR ȘI CONȘTIENT\nîn momentul în care completați un formular de contact. Prelucrăm datele dumneavoastră cu caracter personal pentru a vă putea răspunde la întrebări sau pentru a putea presta serviciile pe care le solicitați sau comandați. Date personale înseamnă orice informație care poate fi legată de o persoană fizică identificată sau identificabilă. Datele personale includ toate tipurile de informații directe sau indirecte, cum ar fi numele complet, adresa de email sau numărul de telefon.\nÎn cazul în care comandați produse de la noi, avem nevoie de aceste informații să vă putem livra produsele comandate.\nAceste informații vor fi stocate în perioada garanției serviciilor sau ale produselor pentru a vă putea contacta în cazul în care este necesar, dar strict legat de produsele și serviciile comandate.\n\n În cazul serviciilor care se reînnoiesc automat, avem nevoie de datele dvs. pentru a emite facturile viitoare și a le trimite pe adresa dvs. în formă electronică sau fizică.\nÎn cazul în care solicitați mai multe informații despre noi printr-un formular sau telefonic, vom utiliza adresa dvs. de email pentru a vă trimite unul sau mai multe mail-uri prin care vă prezentăm serviciile noastre, dar numai în urma unei solicitări concrete și exprese. Adițional dacă specificați numărul de telefon, este posibil să vă sunăm pentru a solicita mai multe informații sau pentru a răspunde la întrebările trimise.\nINFORMAȚII COLECTATE ÎN MOD AUTOMAT\nAdițional site-ul nostru colectează informații despre paginile vizitate și interacțiunea cu conținutul site-ului. Aceste activități vor fi salvate în istoric și vor fi utilizate pentru a analiza erorile apărute și pentru a îmbunătăți site-ul. Aceste log-uri vor conține și adresa dvs. de IP, informații despre browser-ul utilizat cât și despre dispozitivul hardware utilizat (modelul, sistemul de operare, identificator unic al dispozitivului, informații despre rețeaua de pe care vă conectați). Site-ul va plasa și un cookie pe dispozitivul de pe care îl accesați, urmând să fie utilizat pentru identificarea indirectă. Aceste informații nu vor fi utilizate decât pentru operarea site-ului, măsurarea performanței site-ului, traficului și rezultatele campaniilor de marketing. Nu vom vinde sau transfera aceste informații terților, indiferent de raporturile în care suntem cu aceștia, și vom păstra o strictă confidențialitate a lor. Aceste informații nu vor fi utilizate pentru a vă contacta (email, sms sau telefonic), ci pentru a îmbunătăți site-ul nostru, pentru a vă oferi informații relevante, pentru a studia exact ce căutați și a răspunde la întrebări.\nSite-ul nostru utilizează următoarele servicii externe pentru a colecta informațiile:\nGoogle Analitics\nGoogle Adwords și tracking\nFacebook și Facebook pixel\nYoutube\nCum păstrăm datele dvs. cu caracter personal?\nTrebuie să știți că datele personale pe care le-am colectat de la dvs. pot fi accesate doar de echipa noastră și în cazuri excepționale, doar în urma unui demers legal, de instituțiile publice din România care aplică legea.\n\nPrelucrăm datele cu caracter personal aplicând măsurile tehnice și organizatorice adecvate pentru a le proteja împotriva oricărei prelucrări ilegale, distrugerii sau pierderii accidentale sau intenționate, a alterării, divulgării, transmiterii neautorizate sau accesului neautorizat, inclusiv când respectivele date pot fi transmise prin rețea.\nVă rugăm să ne contactați pe adresa de email contact@istoma.ro pentru:\norice neregulă în funcționarea site-ului\norice suspiciune privind insecuritatea aplicației\norice solicitare în legatură cu exercitarea oricărui drept ce vă revine în temeiul legii',
